import React from 'react';

class ProductListing extends React.Component {
  constructor(props) {
    super(props)

    this.state = {
      test: 'test'
    }
  }

  render() {
    return (
      <div>
        <h1>{this.state.test}</h1>
      </div>
    )
  }
}

export default ProductListing;
